export const getFinnhubSymbolFromYahoo = (symbol) => {
    const value = Object.entries(YAHOO_TO_FINNHUB_MAPPING).find(([k, v]) => k === symbol)?.[1];
    return value || symbol;
};

export const getYahooSymbolFromFinnhub = (symbol) => {
    const value = Object.entries(YAHOO_TO_FINNHUB_MAPPING).find(([k, v]) => v === symbol)?.[0];
    return value || symbol;
};